As per the recommendation of Planning and Growth Management Committee on June 18, 2015 amd City Council on July 7, 2015 IItem PG5.4), a settlement has been reached with the applicants for 9 Tippett Road for an application for Official Plan and  Zoning By-law Amendment to permit:
-a mixed use building a total maximum gross floor area of 36,232 m2 resulting in a maximum floor space index of 3.93 times the lot area;
-a maximum of 500 residential dwelling units;
-a minimum of 1, 068.38 m2 of non-residential gross floor area;
-a minimum of 700 m2 of privately-owned publically-accessible (POPS) space;
-the dedication of an unencumbered strip of land a minimum of 9.25 metres wide along the south property boundary for a future east/west road including a turning bulb;
-a north-south 3 metre wide easement along the east property line for a pedestrian walkway to contribute to the Mud Creek Pathway;
-the provision of an east-west pedestrian connection along the north property line to connect Tippett Road with the above-noted north south connection;
-a commitment to provide 25 on-site affordable ownership housing units;
a commitment to provide Section 37 benefits including community space for seniors, possible cash contributions for public art and other local benefits; and cash-in-lieu of parkland.
